import React from 'react';
import back from './Photos/background.png';
import Play from "./components/play"
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={back} alt="back" id="main"/>
      {/* <img src={side} alt="box" id="side"/> */}
      <Play onClick="" className="play"/>
    </div>
  );
}

export default App;
